<script type="text/javascript" charset="utf-8">
	/*原生代码需要注释掉 export {ImageCompress}; */
	document.getElementsByTagName('input')[0].onchange = function() {
		let files = document.getElementsByTagName('input')[0].files;
		// let imgSrc = "http://www.web-tinker.com/share/lena_64px.png";
		let obj = {
			files: files,
			maxsize: 200*1024,  // b
			quality: 0.2,
		}
		ImageCompress(obj, function(arrResult) {
			let arrImage = arrResult;
			document.getElementsByTagName('img')[0].src = arrImage[0].src;
		});
	}
</script>
